import React from "react";
import AliceCarousel from "react-alice-carousel";

import "react-alice-carousel/lib/alice-carousel.css";

const Carousel = ({ items }) => {
  return (
    <React.Fragment>
      <div>
        <AliceCarousel
          mouseTracking
          autoWidth
          autoHeight
          autoPlay
          autoPlayDirection={"ltr"}
        />
      </div>
    </React.Fragment>
  );
};

export default Carousel;
